import React from "react";
import { useNavigate } from "react-router-dom";

function Detail() {
  const nav = useNavigate();

  return (
    <>
      <div className="content">
        <button onClick={Nav("/")}>Accueil</button>
      </div>
    </>
  );
}
export default Detail;
